import React from "react";
import Header from "./Header";
import './Login.css';

const Login = () => {
    const [isLogin,setIsLogin]=useState(false);
  return (
	<div>
        <Header/>
        <div className="login-banner">
          <img src="https://assets.nflxext.com/ffe/siteui/vlv3/dc1cf82d-97c9-409f-b7c8-6ac1718946d6/14a8fe85-b6f4-4c06-8eaf-eccf3276d557/IN-en-20230911-popsignuptwoweeks-perspective_alpha_website_medium.jpg" alt="banner" className="login-banner"/>
        </div>
        <form className="login-form">
            <h1>Sign up</h1>
            <div className="login-form-container">
                <input type='text'placeholder="full name" />
                <input type='email' placeholder="email"/>
                <input type='password'placeholder="password"/>
                <p>{isLogin? "new to netflix":"already have an account?"}</p>
            </div>
        </form>
	</div>
  );
};

export default Login;
